  \"2016-07-27T23:04:41.066608\",\n\t\"name\": \"mid-winter-waterfowl-survey\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Mid-winter Waterfowl Survey is a nationwide
  effort to survey waterfowl in areas of major concentration on their wintering grounds
  and provide winter distribution and habitat affiliations. Some geese and ducks are
  not adequately monitored during the spring and summer because they nest in areas
  not well covered by breeding population surveys. Abundance indices for these species
  are obtained from surveys on wintering areas. Most of these surveys are targeted
  at specific species or populations. A nationwide effort to survey all waterfowl
  is conducted annually in January. This, the Mid-winter Waterfowl Survey, provides
  information on population trends for some species, distribution on the wintering
  grounds, and habitat use. The Mid-Winter Waterfowl Survey is conducted cooperatively
  by the states and the U.S. Fish and Wildlife Service.Survey design and field procedures
  are determined by individual states. The Mid-winter Survey is, today, conducted
  primarily by fixed-wing aircraft, although some states use helicopters and/or conduct
  counts from automobile or boat in certain areas. The Mid-winter Survey is known
  as a u201ccruiseu201d survey, in that specific predefined transects are not defined.
  Instead, an aerial crew determines the best and most practical means to conduct
  a complete count of all waterfowl within a predefined unit area. The exact means
  of coverage may vary from year to year; however, the objective is to obtain a complete
  count of all waterfowl within the survey unit. The survey is conducted annually
  and typically starts the first week of January. Cooperators then enter data into
  a data entry application and the data is sent directly to the respective Flyway
  office where an annual report is produced and data are stored.\",\n\t\"license_title\":
